import "../index.css";
const Info = (props) => {
  console.log("Hello there");
  return (
    <ul id="concepts">
      {props.concepts.map((item) => (
        <li className="concept">
          <div>
            <p>{item.description}</p>
          </div>
        </li>
      ))}
    </ul>
  );
};
export default Info;
